export const ChatWrapper = styled.div`
      display:flex;
      width:100%; 
      position:fixed;
      justify-content:flex-end;
      height:3vh;
      width:30vh;
      right:10%;
      border:1px solid white;
      color:white;
      bottom:0.5%;
`
